import React from "react";
import Card from "./Card";
import Header from "./Header";
import contacts from '../contacts';

function App() {
  return (
    <div>
      <Header />
      <Card name = "M7705" phone = "010-1112-0012" email = "asldkfjasl@naver.com"/>;
      <Card name = "gomgomigom" phone = "010-2344-2342" email = "salkdfj@naver.com"/>;
      {loopingContacts()};
    </div>
  );
}

function loopingContacts() {
  for (let i = 0; i < contacts.length; i++) {
     `<Card name = "${contacts[i].name}" />`
  }

}


export default App;
